import React, { Component } from 'react';
import  './layout.css'

class Layout extends Component {
       
    render() {
        let loggedIn = false;
        console.log(localStorage);
            
        return (
            <div id="main">
                <header>
                    <div className='home'>
                        <a href="/" >Home</a>
                    </div>
                    <div className='sine'>
                        <a href="/register" >Register</a>
                        {loggedIn ? <a>Logout</a> : <a href="/login" >Login</a>}    
                    </div>   
                </header>
                
                {this.props.children}
            </div>
        )
    }

}

export default Layout;
